import { Component } from "react";
import {} from "./style.css"

export class Panel extends Component {
    state = {
        user: "logged"
    }

    render() {
        return (
            <>
                <div className="position">
                    <div className="actions">
                        <a className="boarded" href="#">Start game</a>
                        <a className="boarded" href="#">Tutorial</a>
                    </div>
                    <logo className="logo font">TIC-TAC-TOE9x9</logo>
                    <div>
                        <a className="boarded" href="#">Log in</a>
                        <a className="boarded" href="#">Log out</a>
                    </div>
                </div>
            </>
        )
    }
}
